int main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);
    cout.precision(10);

    for (int i = 0; i < 140; ++i) {
        for (int j = 0; j < 8; ++j) {
            for (int k = 0; k < 8; ++k) {
                known[140 + i][k][j] = known[i][j][k];
            }
        }
    }

    for (int i = 0; i < 140 * 2; ++i) {
        for (int j = 0; j < 8; ++j) {
            for (int k = 0; k < 8; ++k) {
                known[140 * 2 + i][j][7 - k] = known[i][j][k];
            }
        }
    }

    for (int i = 0; i < 140 * 4; ++i) {
        for (int j = 0; j < 8; ++j) {
            for (int k = 0; k < 8; ++k) {
                known[140 * 4 + i][7 - j][k] = known[i][j][k];
            }
        }
    }

    for (int i = 0; i < 140 * 8; ++i) {
        for (int j = 0; j < 8; ++j) {
            for (int k = 0; k < 8; ++k) {
                known[140 * 8 + i][j][k] = 63 - known[i][j][k];
            }
        }
    }

    int data[8][8];

    for (int i = 0; i < 8; ++i) {
        for (int j = 0; j < 8; ++j) {
            cin >> data[i][j];
            data[i][j] -= 1;
        }
    }

    for (int i = 0; i < 140 * 16; ++i) {
        bool ok = true;

        for (int j = 0; j < 8; ++j) {
            for (int k = 0; k < 8; ++k) {
                ok &= data[j][k] < 0 || data[j][k] == known[i][j][k];
            }
        }

        if (ok) {
            for (int j = 0; j < 8; ++j) {
                for (int k = 0; k < 8; ++k) {
                    if (k) {
                        cout << ' ';
                    }
                    cout << known[i][j][k] + 1;
                }
                cout << endl;
            }

            break;
        }
    }

    return 0;
}
